import React from 'react';
import { useRouter } from 'next/router';

const Location = () => {
  const router = useRouter();

  const id = router.query.id;

  console.log(router);

  return <>{id && <span style={{ color: 'hotpink' }}>id:{id}</span>}</>;
};

export default Location;
